####################################################################################################################################
#                                               NUCLEOTIDE REMOVAL GAME                                                            #
#                                                A game for 2 players                                                              #
#                                          There are 2 nucleotide sequences                                                        #
#     In each turn of the game, each player has to remove 2 nucleotides from either sequence, and 1 nucleotide from the other one  #
#                                   The player who is unable to make a valid move wins                                             #
####################################################################################################################################

# Define the 2 nucleotide sequences used in the game
sequence1 = ""
sequence2 = ""

# Turn both nucleotide sequenes into lists, for easier handling of the nucleotide removal process
sequence1_list = list(sequence1)
sequence2_list = list(sequence2)

# Prompt Player 1 to enter their name
player1_name = input("Enter Player 1's name\n")

# Prompt Player 2 to enter their name
player2_name = input("Enter Player 2's name\n")

while True:
    
    ####################
    # Player 1's moves #
    ####################
    
    # If both sequences have less than 2 nucleotides each or either sequence has zero nucleotides, declare Player 1 as the winner, as there is no valid move that can be performed
    if((len(sequence1_list)<2 and len(sequence2_list)<2) or (len(sequence1_list)==0 or len(sequence2_list)==0)):
        print(player1_name+", you won!")
        break
    while True:
        # Prompt Player 1 to either remove 2 nucleotides from the first sequence and 1 from the second one, by entering "1", or 1 from the first one and 2 from the second one, by entering "2"
        player_input = input(player1_name+", will you remove 2 nucleotides from the first sequence and 1 from the second one, or 1 from the first one and 2 from the second one?\nIf you choose the first option, enter '1', otherwise enter '2'.\n")
        
        # Check whether the user's input is valid (in this case, either 1 or 2). If the user has entered a letter, a punctation mark, a symbol, or a number other than 1 or 2, prompt them to enter a valid input
        if not player_input.isdigit() or int(player_input) not in (1,2):
            print("Please enter either '1' or '2'")
            continue
        else:
            # Convert the user's input into an integer, as the input itself is a string by default
            player_input = int(player_input)
            break
    
    if(player_input==1):
        
        # Check if the move that the player selected can be performed. You can't remove, for example, 2 nucleotides from a sequence, if that sequence contains only one
        if(len(sequence1_list)==1):
            print("Invalid move")
        else:
            #Remove 2 nucleotides from the first sequence and 1 nucleotide from the second one
            sequence1_list.pop()
            sequence1_list.pop()
            sequence2_list.pop()
            
            # Display both sequences after removing the nucleotides, with a blank line between them
            print(*sequence1_list)
            print("")
            print(*sequence2_list)
    else:
        # Check if the move that the player selected can be performed. You can't remove, for example, 2 nucleotides from a sequence, if that sequence contains only one
        if(len(sequence2_list)==1):
            print("Invalid move")
        else:
            #Remove 1 nucleotide from the first sequence and 2 nucleotides from the second one
            sequence1_list.pop()
            sequence2_list.pop()
            sequence2_list.pop()
            
            # Display both sequences after removing the nucleotides, with a blank line between them
            print(*sequence1_list)
            print("")
            print(*sequence2_list)
    
    ####################
    # Player 2's moves #
    ####################
    
    # Same for Player 2
    if((len(sequence1_list)<2 and len(sequence2_list)<2) or (len(sequence1_list)==0 or len(sequence2_list)==0)):
        print(player2_name+", you won!")
        break
    
    while True:
        player_input = input(player2_name+", will you remove 2 nucleotides from the first sequence and 1 from the second one, or 1 from the first one and 2 from the second one?\nIf you choose the first option, enter '1', otherwise enter '2'.\n")
        
        if not player_input.isdigit() or int(player_input) not in (1,2):
            print("Please enter either '1' or '2'")
            continue
        else:
            player_input = int(player_input)
            break
    
    if(player_input==1):
        if(len(sequence1_list)==1):
            print("Invalid move")
        else:
            sequence1_list.pop()
            sequence1_list.pop()
            sequence2_list.pop()
            print(*sequence1_list)
            print("")
            print(*sequence2_list)
    else:
        if(len(sequence2_list)==1):
            print("Invalid move")
        else:
            sequence1_list.pop()
            sequence2_list.pop()
            sequence2_list.pop()
            print(*sequence1_list)
            print("")
            print(*sequence2_list)

# In the end, prompt the user to press Enter, in order to exit the program
input("Press Enter to exit the program")